import axios from "axios";
const HOTE_BASE_API_ = "http://localhost:5001/api/hotel/";

class HotelAPIService {

  getMealQuantityTable(date){
    return axios.post(`${HOTE_BASE_API_}mealQuantityTable`, date);
  }
  getOrderTables(date){
    return axios.post(`${HOTE_BASE_API_}ordersTable`, date);
  }

}

export default new HotelAPIService();
